export async function POST(req: NextRequest) {
  // Auth check
  const secret = req.headers.get('x-migration-secret');
  if (secret !== MIGRATION_SECRET) {
    return NextResponse.json({ error: 'Unauthorized' }, { status: 401 });
  }

  const logs: string[] = [];
  const log = (msg: string) => { logs.push(msg); console.log(msg); };

  try {
    log('=== FULL MIGRATION START ===');

    // ---------------------------------------------------------------
    // STEP 1: Create new parent categories (upsert by ID)
    // ---------------------------------------------------------------
    log('\n--- STEP 1: Categories (parents first, then children) ---');

    // Parents first (no parentId)
    const parents = LOCAL_CATEGORIES.filter(c => !c.parentId);
    for (const cat of parents) {
      await prisma.category.upsert({
        where: { id: cat.id },
        create: {
          id: cat.id,
          name: cat.name,
          slug: cat.slug,
          description: cat.description,
          imageUrl: cat.imageUrl,
          sortOrder: cat.sortOrder,
          isActive: cat.isActive,
          updatedAt: new Date(),
        },
        update: {
          name: cat.name,
          slug: cat.slug,
          isActive: cat.isActive,
          updatedAt: new Date(),
        },
      });
      log(`  Parent: ${cat.name} (${cat.slug}) - upserted`);
    }

    // Children (with parentId)
    const children = LOCAL_CATEGORIES.filter(c => c.parentId);
    for (const cat of children) {
      await prisma.category.upsert({
        where: { id: cat.id },
        create: {
          id: cat.id,
          name: cat.name,
          slug: cat.slug,
          description: cat.description,
          imageUrl: cat.imageUrl,
          sortOrder: cat.sortOrder,
          isActive: cat.isActive,
          parentId: cat.parentId,
          updatedAt: new Date(),
        },
        update: {
          name: cat.name,
          slug: cat.slug,
          isActive: cat.isActive,
          parentId: cat.parentId,
          updatedAt: new Date(),
        },
      });
      log(`  Child: ${cat.name} (${cat.slug}) → parent=${cat.parentId} - upserted`);
    }

    // ---------------------------------------------------------------
    // STEP 2: Remap existing Azure products to new categories
    // ---------------------------------------------------------------
    log('\n--- STEP 2: Remap existing products to new categories ---');

    // Get ALL products with their current categories
    const allProducts = await prisma.product.findMany({
      include: { category: true },
    });
    log(`  Total products in DB: ${allProducts.length}`);

    let remapped = 0;
    for (const product of allProducts) {
      const currentSlug = product.category?.slug;
      if (currentSlug && CATEGORY_REMAP[currentSlug]) {
        const newCatId = CATEGORY_REMAP[currentSlug];
        await prisma.product.update({
          where: { id: product.id },
          data: { categoryId: newCatId },
        });
        remapped++;
        if (remapped <= 10) {
          log(`  Remapped: ${product.name} (${currentSlug} → ${newCatId})`);
        }
      }
    }
    if (remapped > 10) log(`  ... and ${remapped - 10} more`);
    log(`  Total remapped: ${remapped}`);

    // ---------------------------------------------------------------
    // STEP 3: Import local products (peptides + accessories)
    // ---------------------------------------------------------------
    log('\n--- STEP 3: Import local products ---');

    const localProducts = await getLocalProducts();
    let imported = 0, skipped = 0;

    for (const prod of localProducts) {
      // Check if already exists by slug
      const existing = await prisma.product.findFirst({ where: { slug: prod.slug } });
      if (existing) {
        // Update category assignment if needed
        if (prod.categoryId) {
          await prisma.product.update({
            where: { id: existing.id },
            data: { categoryId: prod.categoryId },
          });
        }
        skipped++;
        continue;
      }

      // Create product with formats and images
      try {
        await prisma.product.create({
          data: {
            id: prod.id,
            name: prod.name,
            slug: prod.slug,
            subtitle: prod.subtitle,
            shortDescription: prod.shortDescription,
            description: prod.description,
            fullDetails: prod.fullDetails,
            specifications: prod.specifications,
            productType: prod.productType,
            price: prod.price,
            compareAtPrice: prod.compareAtPrice,
            imageUrl: prod.imageUrl,
            videoUrl: prod.videoUrl,
            certificateUrl: prod.certificateUrl,
            certificateName: prod.certificateName,
            dataSheetUrl: prod.dataSheetUrl,
            dataSheetName: prod.dataSheetName,
            categoryId: prod.categoryId,
            weight: prod.weight,
            dimensions: prod.dimensions,
            requiresShipping: prod.requiresShipping,
            sku: prod.sku,
            barcode: prod.barcode,
            manufacturer: prod.manufacturer,
            origin: prod.origin,
            supplierUrl: prod.supplierUrl,
            isActive: prod.isActive,
            isFeatured: prod.isFeatured,
            isNew: prod.isNew,
            isBestseller: prod.isBestseller,
            allowBackorder: prod.allowBackorder,
            trackInventory: prod.trackInventory,
            purity: prod.purity,
            molecularWeight: prod.molecularWeight,
            molecularFormula: prod.molecularFormula,
            aminoSequence: prod.aminoSequence,
            casNumber: prod.casNumber,
            storageConditions: prod.storageConditions,
            coaUrl: prod.coaUrl,
            hplcUrl: prod.hplcUrl,
            msdsUrl: prod.msdsUrl,
            tags: prod.tags,
            customSections: prod.customSections,
            participateResearch: prod.participateResearch,
            relatedResearch: prod.relatedResearch,
            researchSays: prod.researchSays,
          },
        });
        imported++;
        log(`  Imported: ${prod.name} (${prod.slug})`);
      } catch (e: unknown) {
        const msg = e instanceof Error ? e.message : String(e);
        log(`  ERROR importing ${prod.slug}: ${msg.slice(0, 100)}`);
      }
    }
    log(`  Imported: ${imported}, Skipped (exists): ${skipped}`);

    // ---------------------------------------------------------------
    // STEP 4: Import product formats
    // ---------------------------------------------------------------
    log('\n--- STEP 4: Import product formats ---');

    const localFormats = getLocalFormats();
    let fmtImported = 0, fmtSkipped = 0;
    for (const fmt of localFormats) {
      // Check if product exists on Azure
      const prodExists = await prisma.product.findUnique({ where: { id: fmt.productId } });
      if (!prodExists) { fmtSkipped++; continue; }

      const existing = await prisma.productFormat.findFirst({
        where: { productId: fmt.productId, name: fmt.name },
      });
      if (existing) { fmtSkipped++; continue; }

      try {
        await prisma.productFormat.create({
          data: {
            id: fmt.id,
            productId: fmt.productId,
            name: fmt.name,
            formatType: fmt.formatType,
            price: fmt.price,
            comparePrice: fmt.comparePrice,
            isActive: fmt.isActive,
            isDefault: fmt.isDefault,
            stockQuantity: fmt.stockQuantity,
            sku: fmt.sku,
            concentration: fmt.concentration,
            volume: fmt.volume,
            weight: fmt.weight,
            imageUrl: fmt.imageUrl,
            sortOrder: fmt.sortOrder,
          },
        });
        fmtImported++;
      } catch { fmtSkipped++; }
    }
    log(`  Formats imported: ${fmtImported}, skipped: ${fmtSkipped}`);

    // ---------------------------------------------------------------
    // STEP 5: Import product images
    // ---------------------------------------------------------------
    log('\n--- STEP 5: Import product images ---');

    const localImages = getLocalImages();
    let imgImported = 0, imgSkipped = 0;
    for (const img of localImages) {
      const prodExists = await prisma.product.findUnique({ where: { id: img.productId } });
      if (!prodExists) { imgSkipped++; continue; }

      const existing = await prisma.productImage.findFirst({
        where: { productId: img.productId, url: img.url },
      });
      if (existing) { imgSkipped++; continue; }

      try {
        await prisma.productImage.create({
          data: {
            id: img.id,
            productId: img.productId,
            url: img.url,
            alt: img.alt,
            caption: img.caption,
            sortOrder: img.sortOrder,
            isPrimary: img.isPrimary,
            width: img.width,
            height: img.height,
          },
        });
        imgImported++;
      } catch { imgSkipped++; }
    }
    log(`  Images imported: ${imgImported}, skipped: ${imgSkipped}`);

    // ---------------------------------------------------------------
    // STEP 6: Replace FAQs (delete old + import new)
    // ---------------------------------------------------------------
    log('\n--- STEP 6: FAQs (replace all) ---');

    // Delete old FAQ translations first, then FAQs
    const oldFaqCount = await prisma.faq.count();
    await prisma.faqTranslation.deleteMany({});
    await prisma.faq.deleteMany({});
    log(`  Deleted ${oldFaqCount} old FAQs`);

    const localFaqs = getLocalFaqs();
    for (const faq of localFaqs) {
      await prisma.faq.create({
        data: {
          id: faq.id,
          question: faq.question,
          answer: faq.answer,
          category: faq.category,
          productSlug: faq.productSlug,
          sortOrder: faq.sortOrder,
          isActive: faq.isActive,
        },
      });
    }
    log(`  Imported ${localFaqs.length} FAQs`);

    // ---------------------------------------------------------------
    // STEP 7: Replace Articles (delete old + import new)
    // ---------------------------------------------------------------
    log('\n--- STEP 7: Articles (replace all) ---');

    const oldArticleCount = await prisma.article.count();
    await prisma.articleTranslation.deleteMany({});
    await prisma.article.deleteMany({});
    log(`  Deleted ${oldArticleCount} old articles`);

    const localArticles = getLocalArticles();
    for (const art of localArticles) {
      try {
        await prisma.article.create({
          data: {
            id: art.id,
            title: art.title,
            slug: art.slug,
            excerpt: art.excerpt,
            content: art.content,
            category: art.category,
            imageUrl: art.imageUrl,
            author: art.author,
            tags: art.tags,
            isPublished: art.isPublished,
            publishedAt: art.publishedAt ? new Date(art.publishedAt) : null,
            metaTitle: art.metaTitle,
            metaDescription: art.metaDescription,
          },
        });
      } catch (e: unknown) {
        const msg = e instanceof Error ? e.message : String(e);
        log(`  ERROR importing article ${art.slug}: ${msg.slice(0, 100)}`);
      }
    }
    log(`  Imported ${localArticles.length} articles`);

    // ---------------------------------------------------------------
    // STEP 8: Import translations
    // ---------------------------------------------------------------
    log('\n--- STEP 8: Translations ---');

    // Category translations
    const catTrans = getLocalCategoryTranslations();
    let catTransOk = 0;
    for (const t of catTrans) {
      const catExists = await prisma.category.findUnique({ where: { id: t.categoryId } });
      if (!catExists) continue;
      const existing = await prisma.categoryTranslation.findFirst({
        where: { categoryId: t.categoryId, locale: t.locale },
      });
      if (existing) {
        await prisma.categoryTranslation.update({
          where: { id: existing.id },
          data: { name: t.name, description: t.description },
        });
      } else {
        try {
          await prisma.categoryTranslation.create({
            data: { categoryId: t.categoryId, locale: t.locale, name: t.name, description: t.description },
          });
        } catch { continue; }
      }
      catTransOk++;
    }
    log(`  Category translations: ${catTransOk}`);

    // Product translations
    const prodTrans = getLocalProductTranslations();
    let prodTransOk = 0;
    for (const t of prodTrans) {
      const prodExists = await prisma.product.findUnique({ where: { id: t.productId } });
      if (!prodExists) continue;
      const existing = await prisma.productTranslation.findFirst({
        where: { productId: t.productId, locale: t.locale },
      });
      if (!existing) {
        try {
          await prisma.productTranslation.create({
            data: {
              productId: t.productId, locale: t.locale, name: t.name,
              subtitle: t.subtitle, shortDescription: t.shortDescription,
              description: t.description, fullDetails: t.fullDetails,
              specifications: t.specifications,
            },
          });
          prodTransOk++;
        } catch { continue; }
      } else { prodTransOk++; }
    }
    log(`  Product translations: ${prodTransOk}`);

    // FAQ translations
    const faqTrans = getLocalFaqTranslations();
    let faqTransOk = 0;
    for (const t of faqTrans) {
      const faqExists = await prisma.faq.findUnique({ where: { id: t.faqId } });
      if (!faqExists) continue;
      try {
        await prisma.faqTranslation.create({
          data: { faqId: t.faqId, locale: t.locale, question: t.question, answer: t.answer },
        });
        faqTransOk++;
      } catch { continue; }
    }
    log(`  FAQ translations: ${faqTransOk}`);

    // Article translations
    const artTrans = getLocalArticleTranslations();
    let artTransOk = 0;
    for (const t of artTrans) {
      const artExists = await prisma.article.findUnique({ where: { id: t.articleId } });
      if (!artExists) continue;
      try {
        await prisma.articleTranslation.create({
          data: {
            articleId: t.articleId, locale: t.locale, title: t.title,
            excerpt: t.excerpt, content: t.content,
          },
        });
        artTransOk++;
      } catch { continue; }
    }
    log(`  Article translations: ${artTransOk}`);

    // Format translations (batch - largest dataset)
    const fmtTrans = getLocalFormatTranslations();
    let fmtTransOk = 0;
    for (const t of fmtTrans) {
      try {
        const fmtExists = await prisma.productFormat.findUnique({ where: { id: t.formatId } });
        if (!fmtExists) continue;
        const existing = await prisma.productFormatTranslation.findFirst({
          where: { formatId: t.formatId, locale: t.locale },
        });
        if (!existing) {
          await prisma.productFormatTranslation.create({
            data: { formatId: t.formatId, locale: t.locale, name: t.name },
          });
          fmtTransOk++;
        } else { fmtTransOk++; }
      } catch { continue; }
    }
    log(`  Format translations: ${fmtTransOk}`);

    // ---------------------------------------------------------------
    // STEP 9: Cleanup old categories (deactivate unused)
    // ---------------------------------------------------------------
    log('\n--- STEP 9: Deactivate old flat categories ---');

    const oldCatSlugs = Object.keys(CATEGORY_REMAP);
    let deactivated = 0;
    for (const slug of oldCatSlugs) {
      const cat = await prisma.category.findFirst({ where: { slug } });
      if (cat) {
        // Check if any products still reference this category
        const prodCount = await prisma.product.count({ where: { categoryId: cat.id } });
        if (prodCount === 0) {
          await prisma.category.update({
            where: { id: cat.id },
            data: { isActive: false },
          });
          deactivated++;
          log(`  Deactivated: ${slug} (0 products)`);
        } else {
          log(`  KEPT: ${slug} (${prodCount} products still assigned)`);
        }
      }
    }
    log(`  Deactivated: ${deactivated}`);

    // ---------------------------------------------------------------
    // FINAL SUMMARY
    // ---------------------------------------------------------------
    log('\n=== MIGRATION COMPLETE ===');

    const finalStats = {
      categories: await prisma.category.count({ where: { isActive: true } }),
      products: await prisma.product.count({ where: { isActive: true } }),
      faqs: await prisma.faq.count(),
      articles: await prisma.article.count(),
    };
    log(`Final: ${finalStats.categories} categories, ${finalStats.products} products, ${finalStats.faqs} FAQs, ${finalStats.articles} articles`);

    return NextResponse.json({ success: true, logs, stats: finalStats });

  } catch (error: unknown) {
    const msg = error instanceof Error ? error.message : String(error);
    log(`FATAL ERROR: ${msg}`);
    return NextResponse.json({ success: false, error: msg, logs }, { status: 500 });
  }
}

